import './App.css';
import FuelQuoteForm from './FuelQuoteForm';
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
function App() {
  return (
    <div className="App">
<Router>
    <Routes>
    <Route exact path="/" element={
            <>
              <h1>Main Page</h1>
              {/* Link to navigate to the Fuel Quote Form */}
              <Link to="/fuel-quote-form">
                <button className="redirectButton">Go to Fuel Quote Form</button>
              </Link>
            </>
          }/>

    <Route exact path="/fuel-quote-form" element={<FuelQuoteForm/>} />
    </Routes>

  </Router>

  </div>
  );
}

export default App;
